/**
 * 除法
 *
 * @param {number} num1
 * @param {number} num2
 * @returns {number}
 */
declare function divide(num1: number, num2: number): number;
/**
 *乘法
 *
 * @param {number} arg1
 * @param {number} arg2
 * @returns {number}
 */
declare function multiply(arg1: number, arg2: number): number;
/**
 * 加法
 *
 * @param {number} arg1
 * @param {number} arg2
 * @returns {number}
 */
declare function plus(arg1: number, arg2: number): number;
/**
 * 减法
 *
 * @param {number} arg1
 * @param {number} arg2
 * @returns {number}
 */
declare function minus(arg1: number, arg2: number): number;
export { divide, multiply, plus, minus };
